 <head>
     <title>Multi Select 2 Pane</title>
     <style>
      .MSPP_btn {display:block;width:32px;margin:6px;}
     </style>
     <script>

       var MSPP = {
           prefix : 'MSPP_avail_',
           a2c : function(id) { // move selected from avail to chosen
               var availRef = document.getElementById(this.prefix + id);
               var chosenRef = document.getElementById(id);
               var chosenInsertionPoint = (chosenRef.selectedIndex != -1) ? chosenRef[chosenRef.selectedIndex]: null;
               if (availRef.selectedIndex != -1) {
                   for (var i = 0; i < availRef.length; i++) {
                       if (availRef[i].selected) {
                           chosenRef.insertBefore(availRef[i],chosenInsertionPoint);
                       }
                   }
               }
           },
           aa2c : function(id) { // move all avail to chosen
               var availRef = document.getElementById(this.prefix + id);
               var chosenRef = document.getElementById(id);
               var chosenInsertionPoint = (chosenRef.selectedIndex != -1) ? chosenRef[chosenRef.selectedIndex]: null;
               if (availRef.hasChildNodes()) {
                   var srcItems = availRef.childNodes;
                   for (var i = 0; i < srcItems.length; i++) {
                       chosenRef.insertBefore(srcItems[i].cloneNode(true),chosenInsertionPoint);
                   }
               }
               //remove all avail items
               while (availRef.firstChild) {
                  availRef.removeChild(availRef.firstChild);
               }
           },
           c2ax : function(id) { // move selected from chosen back to avail
               var availRef = document.getElementById(this.prefix + id);
               var chosenRef = document.getElementById(id);
               if (chosenRef.selectedIndex != -1) {
                   var selectedChosenOpts = [];
                   for (var i = 0; i < chosenRef.length; i++) {
                       if (chosenRef[i].selected) {
                           selectedChosenOpts.push(chosenRef[i]);
                       }
                   }
                   for (var i = 0; i < selectedChosenOpts.length; i++) {
                       var currentChosenOpt = selectedChosenOpts[i];
                       var currentChosenOptSortIndex = +currentChosenOpt.getAttribute('si');
                       if (availRef.hasChildNodes()) {
                           for (var j = 0; j < availRef.length; j++) {
                               var currentAvailOpt = availRef[j];
                               if (+currentAvailOpt.getAttribute('si') > currentChosenOptSortIndex) {
                                   availRef.insertBefore(currentChosenOpt,currentAvailOpt);
                                   break; // out of j loop
                               }
                               availRef.appendChild(currentChosenOpt);
                           }
                       } else {
                           availRef.appendChild(currentChosenOpt);
                       }
                   }
               }
           },
           cc2a : function(id) { // move all from chosen back to avail
                console.time('t1');
                this.selectAllChosen(id);
                console.timeEnd('t1');
                console.time('t2');
                this.c2a(id);
                console.timeEnd('t2');
           },

           c2a : function (id) { // move selected from chosen back to avail
               var availRef = document.getElementById(this.prefix + id);
               var chosenRef = document.getElementById(id);
               if (chosenRef.selectedIndex != -1) {
                   var newAvailFrame = [];
                   var newChosenFrame = [];
                   var chosenRefLength = chosenRef.length;
                   console.time('t2.1');
                   for (var i = 0; i < chosenRefLength; i++) {
                       var currentChosenRef = chosenRef[i];
                       var optionHtml = currentChosenRef.outerHTML;
                       var si = +optionHtml.match(/ si=\"(.*)\"/)[1];
                       if (currentChosenRef.selected) {
                           newAvailFrame[si] = optionHtml;
                           //newAvailFrame[+currentChosenRef.getAttribute('si')] = currentChosenRef.outerHTML;
                       } else {
                           //newChosenFrame[+currentChosenRef.getAttribute('si')] = currentChosenRef.outerHTML;
                           newChosenFrame[si] = optionHtml;
                       }
                   }
                   console.timeEnd('t2.1');
                   console.time('t2.2');
                   chosenRef.innerHTML = newChosenFrame.join('');
                   console.timeEnd('t2.2');
                   //
                   var availRefLength = availRef.length;
                   console.time('t2.3');
                   for (var i = 0; i < availRefLength; i++) {
                       var currentAvailRef = availRef[i];
                       newAvailFrame[+currentAvailRef.getAttribute('si')] = currentAvailRef.outerHTML;
                   }
                   console.timeEnd('t2.3');
                   console.time('t2.4');
                   //
                   availRef.innerHTML = newAvailFrame.join('');
                   console.timeEnd('t2.4');
               }
           },
           c2u : function(id) { // move selected from chosen one place up
                var chosenRef = document.getElementById(id);
                if (chosenRef.selectedIndex != -1) {
                    var selectedRef = chosenRef[chosenRef.selectedIndex];
                    var prevRef = selectedRef.previousElementSibling;
                    if (prevRef) {
                        chosenRef.insertBefore(selectedRef,prevRef);
                    }
                }
           },
           c2d : function(id) { // move selected from chosen one place down
                var chosenRef = document.getElementById(id);
                if (chosenRef.selectedIndex != -1) {
                    var selectedRef = chosenRef[chosenRef.selectedIndex];
                    var nextRef = selectedRef.nextElementSibling;
                    if (nextRef) {
                        chosenRef.insertBefore(nextRef,selectedRef);
                    }
                }
           },
           selectAllChosen : function(id) {
               var chosenRef = document.getElementById(id);
               if (chosenRef.hasChildNodes()) {
                   var chosenRefLength = chosenRef.length; 
                   for (var i = 0; i < chosenRefLength; i++) {
                       chosenRef[i].selected = true;
                   }
               }
           }
       }

       function test() {

       }


     </script>
